<!doctype html>
<html lang="en">
    <head>
        <link
            rel="manifest"
            href="%sveltekit.assets%/manifest.json"
            crossorigin="use-credentials"
        />
        <link
            rel="icon"
            type="image/ico"
            href="%sveltekit.assets%/favicon.ico"
        />
        <link
            rel="icon"
            type="image/png"
            href="%sveltekit.assets%/favicon.png"
        />
        <link
            rel="icon"
            type="image/png"
            sizes="32x32"
            href="%sveltekit.assets%/favicon-32x32.png"
        />
        <link
            rel="icon"
            type="image/png"
            sizes="16x16"
            href="%sveltekit.assets%/favicon-16x16.png"
        />
        <link
            rel="apple-touch-icon"
            sizes="180x180"
            href="%sveltekit.assets%/apple-touch-icon.png"
        />
        <link
            rel="preload"
            href="%sveltekit.assets%/preview.png"
            as="fetch"
        />
        <link rel="image_src" href="%sveltekit.assets%/preview.png" />
        <link rel="author" href="%sveltekit.assets%/humans.txt" />
        <meta
            name="msapplication-config"
            content="%sveltekit.assets%/ieconfig.xml"
        />
        <meta
            property="og:image"
            content="%sveltekit.assets%/preview.png"
        />
        %sveltekit.head%
    </head>
    <body data-sveltekit-preload-data="hover">
        <div style="display: contents">%sveltekit.body%</div>
    </body>
</html>
